import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App(props) {
  return (
    <div>
      <Header />
      {notes.map((n) => (
        <Note title={n.title} content={n.content} />
      ))}

      <Footer />
    </div>
  );
}

export default App;
